import React from 'react';
import logo from './logo.svg';
import './App.css';
import Cards from "../src/Component/Cards";
import SData from "./Component/SData";


function App() {
  console.log(SData);
  return (
    <div>

      <h1>Welcome to top 5 netflix series</h1>
      function nCard(val){
        <Cards
          imgsrc={val.imgsrc}
          title={val.title}
          sname={val.sname}
          links={val.links}
        />
      }
      SData.map(nCard);
    </div>);
};
export default App;
